CREATE TABLE Stadtteile(
   ID                                                    INTEGER  NOT NULL PRIMARY KEY 
  ,Stadtteilname                                         VARCHAR(33) NOT NULL
  ,Bevölkerung                                           NUMBER(13,0) NOT NULL
  ,Unter_18Jährige                                       NUMBER(12,0) NOT NULL
  ,Anteil_der_unter_18Jährigen_in_                       NUMERIC(9,0) NOT NULL
  ,65Jährige_und_Ältere                                  NUMBER(12,0) NOT NULL
  ,Anteil_der_65Jährigen_und_Älteren_in_                 NUMERIC(9,0) NOT NULL
  ,Ausländerinnen_und_Ausländer                          NUMBER(12,0) NOT NULL
  ,Ausländeranteil_in_                                   NUMERIC(9,0) NOT NULL
  ,Bevölkerung_mit_Migrationshintergrund                 NUMBER(12,0) NOT NULL
  ,Anteil_der_Bevölkerung_mit_Migrationshintergrund_in_  NUMERIC(9,0) NOT NULL
  ,Haushalte                                             NUMBER(13,0) NOT NULL
  ,Personen_je_Haushalt                                  NUMERIC(8,0) NOT NULL
  ,Einpersonenhaushalte                                  NUMBER(12,0) NOT NULL
  ,Haushalte_mit_Kindern                                 NUMBER(12,0) NOT NULL
  ,Alleinerziehende                                      NUMBER(11,0) NOT NULL
  ,Fläche_in_km²                                         NUMERIC(10,0) NOT NULL
  ,Bevölkerungsdichte                                    NUMBER(11,0) NOT NULL
  ,Geburten                                              NUMBER(11,0) NOT NULL
  ,Sterbefälle                                           NUMBER(11,0) NOT NULL
  ,Arbeitslose                                           NUMBER(7,0) NOT NULL
  ,Durchschnittliches_Einkommen_in_EUR                   NUMBER(8,0) NOT NULL
  ,Wohnungen                                             NUMBER(8,0) NOT NULL
  ,Grundschulen                                          NUMBER(3,0) NOT NULL
);
